import React from "react"

export default function Tags(props) {

    const tags = props.data;
    console.log(tags);

    let arrayTags = []

    tags.map((tag) => {
        arrayTags.push(tag)
    })

    return (
        <p>
            {arrayTags}
        </p>
    )
}
